import React from 'react';
import { Link } from 'react-router-dom';
import './Header.css';

const Header = () => {
  return (
    <header className="bg-gray-900 p-4 flex items-center justify-between">
      <Link to="/">
        <img src="/logo.png" alt="ShopSync Logo" className="h-8" />
      </Link>
      <nav>
        <Link to="/" className="text-white mx-2">Home</Link>
        <Link to="/products" className="text-white mx-2">Products</Link>
        <Link to="/brands" className="text-white mx-2">Brands</Link>
        <Link to="/categories" className="text-white mx-2">Categories</Link>
      </nav>
    </header>
  );
};

export default Header;
